    16,nt"tags": [],nt"title": "SPECIES IDENTIFICATION - LIFE STAGE and TAXONOMIC
    CODE tows - plankton tows data collected in the North Atlantic Ocean on NOAA Ship
    ALBATROSS IV, ENDEAVOR and OCEANUS cruises AL9506, AL9605 and others as part of
    the GB project from 1995-02-12 to 1999-05-21 (NODC Accession 0107469)",nt"tracking_summary":
    {ntt"total": 3,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-10-04T04:22:11.183574",nt"name": "species-identification-life-stage-and-taxonomic-code-tows-plankton-tows-data-collected-in-thea8b24",nt"isopen":
    false,nt"url": null,nt"notes": "NODC Accession 0107469 includes tows -
    plankton tows and biological data collected aboard NOAA Ship ALBATROSS IV, ENDEAVOR
    and OCEANUS during cruises AL9506, AL9605, AL9705, AL9801, AL9806, AL9808, AL9901,
    AL9904, EN261, EN263, EN265, EN276, EN278, EN282, EN320, EN322, OC275, OC298, OC300,
    OC301, OC302, OC303, OC317 and OC319 in the North Atlantic Ocean from 1995-02-12
    to 1999-05-21. These data include SPECIES IDENTIFICATION - LIFE STAGE and TAXONOMIC
    CODE. The instruments used to collect these data include net. These data were collected
    by Maria C Casas and Ted Durbin of University of Rhode Island as part of GB. The
    Biological and Chemical Oceanography Data Management Office (BCO-DMO) submitted
    these data to NODC on 2013-04-26.nnThe following is the text of the abstract provided
    by BCO-DMO:nnZooplankton Meter2 Data from GSO/URI - Bongo Nets onlynThe Zooplankton
    Meter2 Database for the Georges Bank GLOBEC project was originally located in the
    laboratory of Ted Durbin at the Graduate School of Oceanography, University of Rhode
    Island. It was accessed via the U.S. GLOBEC Georges Bank data management system
    using SQLPlus network access to the data base management system at URI. Data were
    cached and are served from the local computer.nA description of the original URI
    database is online and includes the design and variable definitions. A version of
    this document is shown here (http://globec.whoi.edu/globec-dir/data_doc/zoo_square_meter_URI.html).nNote:
    Our program's Data Acknowledgment Policy (http://globec.whoi.edu/globec-dir/data-acknowledgement-policy.html)
    requires that any person making substantial use of a data set must communicate with
    the investigators who acquired the data prior to publication and anticipate that
    the data collectors will be co-authors of published results.nThe following documentation
    applies to the data found locally on the WHOI GLOBEC Data Server:nThe data is served
    as a hierarchy. The least changing variables are in higher order levels (e.g., cruise
    id, year, month, etc.), while variables that change the most are in the lower order
    levels (e.g., time of collection, net number, taxon collected, etc.) There are six
    levels within the data; variable names and descriptions are given in the metadata.nMost
    column variable names and instrument names were taken from the U.S. GLOBEC Georges
    Bank data thesaurus; those that were not follow the GLOBEC data protocols. The taxonomic
    code variable (taxon_code) is from the National Oceanographic Data Center's Taxonomic
    List, version 8. Taxonomic information is built into these ten-digit codes as they
    reflect the systematic nomenclature.nYou may contact BCO-DMO for additional help.",nt"license_title":
